import { TextField } from "@mui/material";
import React from "react";

function LoginPage({ setLoginInfo }) {
  return (
    <div className="grid justify-center gap-2 mt-16">
      <TextField name="userName" label="User Name" size="small" />
      <TextField name="password" label="Password" size="small" />
      <Button>
        Login
      </Button>
    </div>
  );
}

export default LoginPage;
